static constexpr Dimension dimension_from_symbol_set(SymbolSet set) noexcept {
	switch(set) {
		case SymbolSet::AIR:
		case SymbolSet::AIR_MISSILE:
			return Dimension::AIR;
		case SymbolSet::SPACE:
		case SymbolSet::SPACE_MISSILE:
			return Dimension::SPACE;
		case SymbolSet::LAND_UNIT:
		case SymbolSet::LAND_CIVILIAN_UNIT_ORGANIZATION:
		default:
			return Dimension::LAND_UNIT;
		case SymbolSet::LAND_EQUIPMENT:
			return Dimension::LAND_EQUIPMENT;
		case SymbolSet::LAND_INSTALLATION:
			return Dimension::LAND_INSTALLATION;
		case SymbolSet::ACTIVITIES:
			return Dimension::ACTIVITIES;
		case SymbolSet::DISMOUNTED_INDIVIDUAL:
			return Dimension::DISMOUNTED_INDIVIDUAL;
		case SymbolSet::SEA_SURFACE:
			return Dimension::SEA_SURFACE;
		case SymbolSet::SEA_SUBSURFACE:
			return Dimension::SEA_SUBSURFACE;
		case SymbolSet::CYBERSPACE:
			return Dimension::CYBERSPACE;
			return Dimension::POSITION_MARKER;
	}
}

static constexpr int get_full_frame_ordering(Affiliation affiliation) noexcept {
	switch(get_frame_affiliation(affiliation)) {
		case Affiliation::HOSTILE:
			return 0;
		case Affiliation::FRIEND:
			return 1;
		case Affiliation::NEUTRAL:
			return 2;
		case Affiliation::UNKNOWN:
			return 3;
		default:
			return 3;
	}
}

